function renderSidebar() {
  document.body.insertAdjacentHTML("afterbegin", sidebarHTML);
  const currentPath = window.location.pathname;
  const links = document.querySelectorAll(".sidebar-link");
  links.forEach((link) => {
    const linkHref = link.getAttribute("href");
    let isActive = false;
    if (linkHref === "./" || linkHref === "../") {
      if (currentPath.endsWith("/") || currentPath.endsWith("index.html")) {
        if (
          !currentPath.includes("jadwal") ||
          (!currentPath.includes("form") && !currentPath.includes("schedules"))
        ) {
          isActive = true;
        }
      } // Sidebar Link
    } else if (linkHref.includes("form") && currentPath.includes("form")) {
      isActive = true;
    } else if (linkHref.includes("schedules") && currentPath.includes("schedules")) {
      isActive = true;
    } else if (linkHref.includes("jadwal") && currentPath.includes("jadwal")) {
      isActive = true;
    }
    if (isActive) {
      link.className =
        "sidebar-link flex items-center gap-3 px-4 py-3 text-sm font-medium bg-indigo-50 text-indigo-700 rounded-xl";
    } else {
      link.className =
        "sidebar-link flex items-center gap-3 px-4 py-3 text-sm font-medium text-gray-500 hover:bg-gray-50 hover:text-gray-900 rounded-xl transition-colors";
    }
  });
}
function toggleSidebar() {
  const sidebar = document.getElementById("sidebar");
  const overlay = document.getElementById("mobileOverlay");

  if (sidebar.classList.contains("-translate-x-full")) {
    sidebar.classList.remove("-translate-x-full");
    overlay.classList.remove("hidden");
    setTimeout(() => overlay.classList.remove("opacity-0"), 10);
  } else {
    sidebar.classList.add("-translate-x-full");
    overlay.classList.add("opacity-0");
    setTimeout(() => overlay.classList.add("hidden"), 300);
  }
}
document.addEventListener("DOMContentLoaded", renderSidebar);
